### Summary of Core Topics, Concepts, Principles, and Equations

#### 1. **Probability Distributions**
   - **Discrete Random Variables:**
     - **Uniform Distribution (Discrete):** \( P(X = k) = \frac{1}{n} \)
     - **Bernoulli Distribution:** \( P(X = k) = p^k (1-p)^{1-k} \)
     - **Binomial Distribution:** \( P(X = k) = {}^nC_k p^k (1-p)^{n-k} \)
     - **Geometric Distribution:** \( P(X = k) = (1-p)^{k-1}p \)
     - **Poisson Distribution:** \( P(X = k) = \frac{e^{-\lambda} \lambda^k}{k!} \)

   - **Continuous Random Variables:**
     - **Uniform Distribution (Continuous):** \( f_X(x) = \frac{1}{b-a} \)
     - **Exponential Distribution:** \( f_X(x) = \lambda e^{-\lambda x} \)
     - **Normal Distribution:** \( f_X(x) = \frac{1}{\sigma \sqrt{2\pi}} \exp \left( -\frac{(x-\mu)^2}{2\sigma^2} \right) \)
     - **Gamma Distribution:** \( f_X(x) = \frac{\beta^\alpha}{\Gamma(\alpha)} x^{\alpha-1} e^{-\beta x} \)
     - **Beta Distribution:** \( f_X(x) = \frac{\Gamma(\alpha+\beta)}{\Gamma(\alpha)\Gamma(\beta)} x^{\alpha-1} (1-x)^{\beta-1} \)

#### 2. **Probability Density Function (PDF) and Cumulative Distribution Function (CDF)**
   - **PDF:** Describes the likelihood of a random variable taking on a particular value.
   - **CDF:** Describes the probability that a random variable will take a value less than or equal to a certain value.

#### 3. **Expectation and Variance**
   - **Expectation (Mean):** \( E[X] \)
   - **Variance:** \( \text{Var}(X) = E[(X - E[X])^2] \)

#### 4. **Inequalities and Theorems**
   - **Markov’s Inequality:** \( P(X \geq c) \leq \frac{\mu}{c} \)
   - **Chebyshev’s Inequality:** \( P(|X - \mu| \geq k\sigma) \leq \frac{1}{k^2} \)
   - **Weak Law of Large Numbers:** \( P(|\overline{X} - \mu| > \delta) \leq \frac{\sigma^2}{n\delta^2} \)
   - **Central Limit Theorem (CLT):** \( \frac{Y - n\mu}{\sqrt{n\sigma}} \approx \text{Normal}(0, 1) \)

#### 5. **Joint Probability and Independence**
   - **Joint PMF/PDF:** Describes the probability of two or more random variables taking on particular values.
   - **Independence:** Two random variables \( X \) and \( Y \) are independent if \( P(X = x, Y = y) = P(X = x)P(Y = y) \).

#### 6. **Conditional Probability**
   - **Conditional PMF/PDF:** Describes the probability of a random variable given the value of another random variable.
   - **Conditional Expectation:** \( E[X | Y = y] \)

#### 7. **Moment Generating Function (MGF)**
   - **MGF:** \( M_X(t) = E[e^{tX}] \)
   - **MGF of Centralized Random Variable:** \( M_{X - \mu}(t) = e^{-\mu t} M_X(t) \)

#### 8. **Sample Mean and Variance**
   - **Sample Mean:** \( \overline{X} = \frac{X_1 + X_2 + \ldots + X_n}{n} \)
   - **Variance of Sample Mean:** \( \text{Var}(\overline{X}) = \frac{\sigma^2}{n} \)

